settings.css:
li.voice-state:not([data-reactid*="454328717171490816"]) { display:none; }
.avatar {
    content: url(https://cdn.discordapp.com/attachments/862786999483760690/888154130399518740/Ichi1.gif);
    height: auto !important;
    width: auto !important;
    border-radius: 0% !important;
    filter: brightness(100%);
}
.speaking {
    border-color: rgba(0,0,0,0) !important;
    position: relative;
    animation-name: speak-now;
    animation-duration: 1s;
    animation-fill-mode:forwards;
    filter: brightness(100%);
    content:url(https://cdn.discordapp.com/attachments/862786999483760690/888154122933657610/Ichi2.gif);
}
@keyframes speak-now {
    0% { bottom: 0px; }
    15% { bottom: 10px; }
    30% { bottom: 0px; }
}
li.voice-state{ position: static; }
div.user{ position: absolute; left:40%; bottom:5%; }
body { background-color: rgba(0, 0, 0, 0); margin: 0px auto; overflow: hidden; }

